// Task https://leetcode.com/problems/minimum-penalty-for-a-shop/
fun main() {
    println(bestClosingTime("YYNY"))
    println(bestClosingTime("NNNNN"))
    println(bestClosingTime("YYYY"))
    println(
        bestClosingTime(
            ""
        )
    )
}

fun bestClosingTime(customers: String): Int {
    var best  = 0
    var points = 0
    var bestHour = -1
    customers.forEachIndexed { time, char ->
        points += if (char == 'Y') 1 else -1
        if (points > best) {
            best = points
            bestHour = time
        }
    }
    return bestHour + 1
}